import React from 'react';
import '../css/Card.css';
import { Link } from 'react-router-dom';

const Card = ({ item }) => {

  return (
    <div className='card'>

        <span className='title'>{item.author}</span>
        <img src={item.urlToImage} alt="" className='img' />
        <p className='desc'>{item.description}</p>

    </div>
  );  
};

export default Card;
